import React from "react";

import {
    Text,
    Hr, TopHr, BotHr
} from "./UserInfo.style";

import {
    Row,
    Col
} from "react-bootstrap";


const Projects = () => (
    <Col md={12} className="">
        <Text>
            <h1 className="user-info-title" style={{fontSize: "1.6em"}}> Projects </h1>
            <TopHr/>
            <Row>
                <Col md={1}></Col>
                <Col md={11}>
                    <p className="user-info-body">&#9677;
                        <b> Dual-tone multi-frequency signaling (DTFM)</b> ,
                        Undergraduate Signal Course, Department of Computer engineering, IUST, Tehran, Iran, May,
                        2019
                    </p>
                </Col>
                <Col md={2}></Col>
                <Col md={10}>
                    <p className="user-info-body">&#9675;
                        Developed a program (in Python), using the NumPy and FFT library to detect the voice-frequency
                        band over telephone lines.
                    </p>
                </Col>

            </Row>
        </Text>
    </Col>
)


export default Projects;
